import React, { Component } from "react";
import { Router } from "react-router-dom";
import Boardfile from "./Boardfile";
import Listfile from "./Listfile";
const token =
  "52615ebb3fb8336a474fd1ab9ec8ae053f5321433e1cbfefefb33a1779816ba9";
const url = "https://api.trello.com";
const key = "23fe0646c0d1253eb430f7e02db925a0";

const Board = (props) => {
  return (
    <div>
      <Router to={`/board${this.props.id}`}>
        <div className="card bg-warning text-white m-2">
          <div className="card-body">{this.props.name}</div>
        </div>
      </Router>
    </div>
  );
};
export default Board;
